import React, { Component } from "react";
import About from "./About.jsx";
import Competence from "./Competence.jsx";
import Projects from "./Projects.jsx";

class Home extends Component {
  render() {
    return (
      <React.Fragment>
        <About />
        <Competence />
        <Projects />
      </React.Fragment>
    );
  }
}

export default Home;
